import { Col, Card } from "react-bootstrap";
import { useHistory } from "react-router-dom";

export default function RestaurantCard(props) {
	const { name, image, id, distance } = props.data;
	const handleClick = () => {
		history.push(`/retaurant/${id}`);
	};
	return (
		<Col xs={12} md={6} lg={3} className="mb-4">
			<Card style={{ border: "none", cursor: "pointer" }} onClick={handleClick}>
				<Card.Img
					variant="top"
					src={image}
					height="175"
					className="p-3"
					style={{ objectFit: "cover" }}
				/>
				<Card.Body className="px-3 pt-0">
					<Card.Title className="heading font-weight-bolder">{name}</Card.Title>
					<Card.Text className="heading">{distance} KM</Card.Text>
				</Card.Body>
			</Card>
		</Col>
	);
}
